from sklearn.preprocessing import LabelEncoder
from sklearn import preprocessing

# Creating labelEncoder
le = preprocessing.LabelEncoder()

data['credit card debt']=le.fit_transform(data['credit card debt'])
data['gender']=le.fit_transform(data['gender'])

data.describe()

data.head(10)

# Visualizar en un mapa de calor la correlación entre los atributos numéricos pero esta vez
# con la clase numérica ver si hay correlación
plt.figure(figsize=(16,7))
sns.heatmap(data.corr(),annot=True,cmap="Paired")
plt.show()

# Dividir los datos en vector de características X y clase y
# Se recomienda despuésde hacer este paso normalizar los valores del dataset
# Esto se hace para que todos los atributos se encuentren entre los valores 0 y 1,
# siguiendo el modelo de una distribución normal N(0,1)
X=data.loc[:,data.columns!='credit card debt'] # Los dos puntos indican todas las filas, todas las columnas
                                      # diferentes a Outcome hacen parte de la matriz X que se conoce como vector de características
y=data['credit card debt']
X

# Normalizar los datos del vector de características
from sklearn.preprocessing import MinMaxScaler

min_max_scaler = MinMaxScaler()
X

X = min_max_scaler.fit_transform(X)
print(min_max_scaler.transform(X)[0:10])

print(X)

print(y)

# Importar librería para crear los conjuntos de datos "X" y "y", de entrenamiento y prueba
from sklearn.model_selection import train_test_split

# Se crean cuatro subconjuntos
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3)  # 70% entrenamiento y 30% prueba



print(X_train.shape)
print(X_test.shape)
print(y_train.shape)
print(y_test.shape)

# Importar MLPClassifer que es el algoritmo de redes neuronales MultilayerPerceptron
from sklearn.neural_network import MLPClassifier

# Crear el modelo para después ajustarlo con los datos de entrenamiento X_train/y_train
clf_mlp = MLPClassifier(hidden_layer_sizes=(6,5), # Se colocan dos capas ocultas de 6 y 5 neuronas respectivamente
                    random_state=5, # Para que la salida siempre sea con los mismos datos de entrada
                    verbose=True, # Mostrar la salida de las iteraciones
                    learning_rate_init=0.001) # Tasa de aprendizaje

# Se ajusta el modelo a los datos y se selecciona el modelo que presente la menor pérdida (loss)
clf_mlp.fit(X_train,y_train)

# Hacer las predicciones en el conjunto de prueba y después proceder a compararlo con su valor real de y_test
ypred=clf_mlp.predict(X_test)

# Ver la predicción
print(ypred)

# Importar librerías necesarias
from sklearn.metrics import classification_report # Reporte de clasificación con varias métricas
from sklearn.metrics import roc_auc_score # Solo para clases binarias
from sklearn.metrics import confusion_matrix # Matriz de confusión (origen de las métricas)

# Calcular accuracy y otras métricas  (exactitud)
print(confusion_matrix(y_test,ypred),"\n\n") # Matriz de confusión en la diagonal principal se situan las instancias correctamente clasificadas
print(classification_report(y_test,ypred))
print("ROC-AUC-Area: ",str(roc_auc_score(y_test,ypred))) # Solo funciona con clases binarias

