"""El mejor modelo es el modelo de Regresión Logística, que clasifica bien el 69,4% de las veces de acuerdo a la métrica ROC-AUC. Ojo que estamos  trabajado con clases desbalanceadas lo que hace que el rendimiento del modelo no sea el mejor.

:# Con clases balanceadas
Apliquemos uno de los algoritmos para tratar el desbalance de los datos haciendo una penalización a la clase mayorítaria "No", este hiperparámetro solo funciona en el algoritmo de IA, hay otros algoritmos que son más generales como los de under y over sampling.
"""

from sklearn import tree
clf_arbol_imb=tree.DecisionTreeClassifier(criterion='entropy', min_samples_split=20,
                                             min_samples_leaf=5, max_depth = 8,class_weight="balanced")

# Ajuste de los datos de entrenamiento al clasificador
clf_arbol_imb.fit(X_train,y_train)
ypred_arbol_imb=clf_arbol_imb.predict(X_test)

# Calcular accuracy y otras métricas algoritmo de árboles
print(confusion_matrix(y_test,ypred_arbol_imb),"\n\n") # Matriz de confusión en la diagonal principal se situan las instancias correctamente clasificadas
print(classification_report(y_test,ypred_arbol_imb))
print("ROC-AUC-Area: ",str(roc_auc_score(y_test,ypred_arbol_imb))) # Solo funciona con clases binarias

